description:
An auxiliary package that allows you to create observable grouped collections from Realm models using Backlinks. With the following models:

public class School : RealmObject
{
    [Backlink(nameof(Student.School))]
    public IQueryable<Student> Students { get; }
}

public class Student : RealmObject
{
    public School School { get; set; }
}

you can create a grouping like:

var grouped = realm.All<School>().ToGroupedCollection(school => school.Students);

This can then be passed to a grouped XF ListView that will show students grouped by school.
